import React from "react";
import {Link} from "react-router-dom";

const Contact = () => {
    return(
        <div>
            <form action="">
            <div class="input-group">
                 <input type="text" required />
                 <span class="highlight"></span>
                 <span class="bar"></span>
                <label>Name</label>
            </div>

            <div class="input-group">
                <input type="password" required />
                <span class="highlight"></span>
                <span class="bar"></span>
                <label>email</label>
            </div>

            </form>
        </div>
    )
}

export default Contact;
